import React, { Component } from "react";
import { Line, Circle } from "rc-progress";


export class StepThree extends Component {
  continue = (e) => {
    e.preventDefault();
    // PROCESS FORM //
    this.props.nextStep();
  };

  back = (e) => {
    e.preventDefault();
    this.props.prevStep();
  };

  render() {
    return (
      <div class="logcardback2">
        <div className="sign-text">ALMOST DONE!</div>
        <div class="prog">
          <Line
            percent="100"
            strokeWidth="2"
            strokeColor="#B74852"
            trailWidth="1"
            trailColor="white"
          />
        </div>
        <div>
          <img class="verify" src="/images/verify.svg" alt="" />
        </div>
        <div>
          <a href="#" class="button" role="button">
            Lets Go!
          </a>
        </div>
      </div>
    );
  }
}

export default StepThree;
